 $(document).ready(function(){
        $('#send_message').click(function(e){
            
            // Stop form submission & check the validation
            e.preventDefault();
            
            // Variable declaration
            var error = false;
            
            var email = $('#exampleInputEmail').val();
            var subject = $('#exampleInputSubject').val();
            var message = $('#exampleInputMessage').val();
            
         	
            if(email.length == 0 || email.indexOf('@') == '-1'){
                var error = true;
                // $('#email_error').fadeIn(500);
                $('#exampleInputEmail').addClass("validation");
                
            }else{
                $('#exampleInputEmail').removeClass("validation");
            }
            if(subject.length == 0){
                var error = true;
                $('#exampleInputSubject').addClass("validation");
            }else{
                $('#exampleInputSubject').removeClass("validation");
            }
            if(message.length == 0){
                var error = true;
                $('#exampleInputMessage').addClass("validation");
            }else{
                $('#exampleInputMessage').removeClass("validation");
            }
            
            // If there is no validation error, next to process the mail function
            if(error == false){
               // Disable submit button just after the form processed 1st time successfully.
                
                $('#send_message').attr({'enabled' : 'enable', 'value' : 'envoi en cours...' });
                
                /* Post Ajax function of jQuery to get all the data from the submission of the form as soon as the form sends the values to email.php*/
                $.ajax({
                    url: 'https:' + '//formspree.io/' + 'gaspard' + '@' + 'revovision' + '.' + 'ca', 
                    method: 'POST',
                    data: $("#contact_form").serialize(),
                    dataType: 'json',
                    success: function(data){
                        console.log('success', data);
                        $('#send_message').attr({'enabled' : 'enable', 'value' : 'envoyer' });
                        //Display the success message
                        $('#mail_success').fadeIn(500);
                    },
                    error: function(data){
                        console.log('error', data);
                        //Display the error message
                        $('#mail_fail').fadeIn(500);
                        // Enable the submit button again
                        $('#send_message').removeAttr('disabled').attr('value', 'Envoyer le message');
                    }
                });
            }
        });    
    });
